import React, { Component } from 'react'
import WeatherService from '../service/WeatherService';

class WeatherListComponent extends Component {
    constructor(props) {
        super(props)
        this.state = {
            weathers: [],
            message: null,
            sortBy: "name",
            id_is_ascending: true,
            name_is_ascending: true,
            lat_is_ascending: true,
            lon_is_ascending: true,
            country_is_ascending: true,
            humidity_is_ascending: true,
            feels_like_is_ascending: true,
            temp_is_ascending: true,
            temp_max_is_ascending: true,
            temp_min_is_ascending: true,
            description_is_ascending: true,

        }
        // this.deleteWeatherClicked = this.deleteWeatherClicked.bind(this)
        // this.updateWeatherClicked = this.updateWeatherClicked.bind(this)
        // this.addWeatherClicked = this.addWeatherClicked.bind(this)
        // this.refreshWeathers = this.refreshWeathers.bind(this)
    }

    componentDidMount() {
        this.refreshWeathers(this.state.sortBy, this.state.isAscending);
    }

    refreshWeathers(sortBy, paramIsAscending) {
        WeatherService.retrieveAllWeathers(sortBy, "this.state.\"${paramIsAscending}\"")
            .then(
                response => {
                    //console.log(response);
                    this.setState({ weathers: response.data })
                }
            ).then( r => {
                console.log("param: " + paramIsAscending + "this.state.\"${paramIsAscending}\"")
            this.setState({"this.state.\"${paramIsAscending}\"": !"this.state.\"${paramIsAscending}\""})})
    }

    render() {
        console.log('render')
        return (
            <div className="container">
                <h3>All Weathers</h3>
                {this.state.message && <div class="alert alert-success">{this.state.message}</div>}
                <div className="container">
                    <div className="row">
                        <button className="btn btn-success" onClick={() => this.refreshWeathers()}>Refresh</button>
                    </div>
                    <table className="table">
                        <thead>
                            <tr>
                                <th onClick={() =>this.refreshWeathers("id", "id_is_ascending") }>cityId</th>
                                <th onClick={() =>this.refreshWeathers("name", "name_is_ascending") }>city Name</th>
                                <th onClick={() =>this.refreshWeathers("coord.lat", "lat_is_ascending") }>latitude</th>
                                <th onClick={() =>this.refreshWeathers("coord.lon", "lon_is_ascending") }>longitude</th>
                                <th onClick={() =>this.refreshWeathers("sys.country", "country_is_ascending") }>country</th>
                                <th onClick={() =>this.refreshWeathers("weatherMain.humidity", "humidity_is_ascending") }>humidity</th>
                                <th onClick={() =>this.refreshWeathers("weatherMain.feels_like", "feels_like_is_ascending") }>feels like</th>
                                <th onClick={() =>this.refreshWeathers("weatherMain.temp", "temp_is_ascending") }>temperature</th>
                                <th onClick={() =>this.refreshWeathers("weatherMain.temp_max", "temp_max_is_ascending") }>maximum temperature</th>
                                <th onClick={() =>this.refreshWeathers("weatherMain.temp_min", "temp_min_is_ascending") }>minimal temperature</th>
                                <th onClick={() =>this.refreshWeathers("weather.description", "description_is_ascending") }>description</th>                                
                                {/* <th>Update</th> */}
                                {/* <th>Delete</th> */}
                            </tr>
                        </thead>
                        <tbody>
                            {
                                this.state.weathers.map(
                                    weather =>
                                        <tr key={weather.id}>
                                            <td>{weather.id}</td>
                                            <td>{weather.name}</td>
                                            <td>{weather.coord.lat}</td>
                                            <td>{weather.coord.lon}</td>
                                            <td>{weather.sys.country}</td>
                                            <td>{weather.weatherMain.humidity}</td>
                                            <td>{weather.weatherMain.feels_like}</td>
                                            <td>{weather.weatherMain.temp}</td>
                                            <td>{weather.weatherMain.temp_max}</td>
                                            <td>{weather.weatherMain.temp_min}</td>
                                            <td>{weather.weather[0].description}</td>

                                            {/* <td><button className="btn btn-success" onClick={() => this.updateCourseClicked(course.id)}>Update</button></td> */}
                                            {/* <td><button className="btn btn-warning" onClick={() => this.deleteCourseClicked(course.id)}>Delete</button></td> */}
                                        </tr>
                                )
                            }
                        </tbody>
                    </table>
                    {/* <div className="row"> */}
                        {/* <button className="btn btn-success" onClick={this.addCourseClicked}>Add</button> */}
                    {/* </div> */}
                </div>
            </div>
        )
    }
}
export default WeatherListComponent
